        <h3 style={{ color: '#2e7d32' }}>Recomenda√ß√µes</h3>
        <div style={{ display: 'flex', flexWrap: 'wrap', gap: '15px', justifyContent: 'center' }}>
          <div style={cardStyle}>
            <p><strong>Juliana</strong></p>
            <p>Doa 5 livros de programa√ß√£o orientada a objetos.</p>
